import React from 'react'

export const  Button= ({ID,style}) => {
    const stylee=(ID)=>{
        if(ID==="LogIn")
    {
        return {
            width: "150px",
            height: "56px",
            flexShrink: 0,
            borderRadius: "6px",
            background: "#74BDE0",
          };
                   
    }
    else
    {
        return{
            width: "150px",
            height: "56px",
            flexShrink: 0,
            borderRadius: "6px",
            border: "1px solid #74BDE0",
        }

    }
    }
  return (
    <div>
        <button style={{...style,...stylee()}}>{ID}</button>
    </div>
  )
}
export default Button
